description:
English | CBZ | 4 Issues

Wonder Woman v2 #72-75
Publisher:  DC Comics
Publication Date:  March - June 1993

Writer:  William Messner-Loebs
Penciller:  Lee Moder
Inker:  Ande Parks
Colorist:  Matt Hollingsworth (#72-74) and Steve Mattsson (#75)
Letterer:  John Costanza
Cover Artist:  Brian Bolland

Wonder Woman #72
As Wonder Woman picks up the pieces of her life, she reflects on her origin, helping her to adjust to the changed world to which she has returned as she reexamines her role as a heroine. 

Wonder Woman #73
Paradise Island is missing! But before Diana can begin the search, a greater challenge presents itself--she has to find a job!

Wonder Woman #74
Diana's first case with private detective Micah Raines leads to a violent confrontation with a desperate computerized terrorist--and with the White Magician, the city's new &quot;hero.&quot;

Wonder Woman #75
In an attempt to restore the badly burned Brian Elliott's health, Diana finds herself wrapped up in hospital intrigue. Also, the so-called White Magician is somehow connected to the attempted assassination of police officer Isabelle Modini.

Thanks goes to Ok C.O.M.P.U.T.O. for this release.

